INSERT INTO `activity_logs` VALUES ('2', NULL, NULL, 'create', 'App\\Models\\Destination', '1', 'Menambahkan destinasi baru: Danau Tambing', NULL, '{\"id\": 1, \"city\": \"Kabupaten Poso\", \"name\": \"Danau Tambing\", \"slug\": \"danau-tambing\", \"rules\": [\"Dilarang membuang sampah sembarangan\", \"Dilarang berenang di danau\", \"Dilarang membawa hewan peliharaan\", \"Wajib menjaga ketenangan\", \"Dilarang memetik tanaman dan mengganggu satwa\", \"Pembayaran tiket non-tunai (cashless)\"], \"images\": [], \"prices\": [], \"rating\": \"4.8\", \"address\": \"Desa Sedoa, Kecamatan Lore Utara\", \"latitude\": \"-1.32110000\", \"province\": \"Sulawesi Tengah\", \"is_active\": true, \"longitude\": \"120.18500000\", \"created_at\": \"2026-01-04T17:17:45.000000Z\", \"facilities\": [\"Toilet\", \"Warung\", \"Parkir Motor & Mobil\", \"Gazebo\", \"Jembatan Bambu\", \"Spot Foto\", \"Area Camping\"], \"updated_at\": \"2026-01-04T17:17:45.000000Z\", \"description\": \"Danau Tambing adalah sebuah danau cantik yang terletak di kawasan Taman Nasional Lore Lindu, Sulawesi Tengah. Danau ini berada di ketinggian sekitar 1.700 meter di atas permukaan laut, menjadikannya salah satu destinasi wisata alam paling memukau di Indonesia.\\n\\nAir danau yang jernih berwarna hijau kebiruan mencerminkan keindahan alam sekitarnya, termasuk pepohonan rapat dan langit biru. Suasana tenang dan sejuk khas pegunungan tropis menjadikan tempat ini sempurna untuk healing dan menikmati keindahan alam.\\n\\nDanau Tambing tidak hanya menjadi daya tarik wisata, tetapi juga memiliki nilai ekologis tinggi sebagai habitat berbagai spesies flora dan fauna endemik Sulawesi.\", \"is_featured\": true, \"review_count\": 256, \"contact_email\": \"info@tnll-explore.com\", \"contact_phone\": \"+62 451 123456\", \"visitor_count\": 12450, \"operating_hours\": \"07:00 - 17:00 WITA\", \"primary_image_url\": \"http://localhost:8000/assets/logo.png\", \"short_description\": \"Danau eksotis di ketinggian 1.700 mdpl dengan pemandangan hutan pegunungan yang masih asri.\", \"formatted_adult_price\": \"Gratis\"}', '127.0.0.1', 'Symfony', '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `activity_logs` VALUES ('3', NULL, NULL, 'create', 'App\\Models\\Destination', '2', 'Menambahkan destinasi baru: Danau Lindu', NULL, '{\"id\": 2, \"city\": \"Kabupaten Sigi\", \"name\": \"Danau Lindu\", \"slug\": \"danau-lindu\", \"rules\": [\"Hormati adat istiadat masyarakat Lindu\", \"Dilarang membuang sampah ke danau\", \"Sewa perahu melalui koperasi desa\", \"Wajib didampingi pemandu lokal (tracking)\"], \"images\": [], \"prices\": [], \"rating\": \"4.7\", \"address\": \"Desa Tomado, Kecamatan Lindu\", \"latitude\": \"-1.30890000\", \"province\": \"Sulawesi Tengah\", \"is_active\": true, \"longitude\": \"120.06670000\", \"created_at\": \"2026-01-04T17:17:45.000000Z\", \"facilities\": [\"Dermaga Perahu\", \"Homestay\", \"Warung Makan\", \"Toilet\", \"Spot Memancing\", \"Parkir\"], \"updated_at\": \"2026-01-04T17:17:45.000000Z\", \"description\": \"Danau Lindu adalah danau alami terbesar di Taman Nasional Lore Lindu, terletak di tengah kawasan taman nasional pada ketinggian 1.000 meter. Danau ini dikelilingi oleh pegunungan dan hutan hujan tropis yang masih alami.\\n\\nMasyarakat suku Lindu yang tinggal di sekitar danau masih mempertahankan tradisi dan kearifan lokal mereka. Anda bisa berinteraksi dengan penduduk, memancing bersama warga lokal, atau menyewa perahu ketinting untuk mengelilingi danau.\\n\\nDanau Lindu juga merupakan habitat bagi beberapa spesies ikan endemik yang hanya ditemukan di sini.\", \"is_featured\": true, \"review_count\": 189, \"contact_email\": \"info@tnll-explore.com\", \"contact_phone\": \"+62 451 123457\", \"visitor_count\": 8920, \"operating_hours\": \"06:00 - 18:00 WITA\", \"primary_image_url\": \"http://localhost:8000/assets/logo.png\", \"short_description\": \"Danau alami terbesar di TNLL dengan kehidupan masyarakat adat Lindu yang masih asli.\", \"formatted_adult_price\": \"Gratis\"}', '127.0.0.1', 'Symfony', '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `activity_logs` VALUES ('4', NULL, NULL, 'create', 'App\\Models\\Destination', '3', 'Menambahkan destinasi baru: Lembah Bada - Situs Megalitikum', NULL, '{\"id\": 3, \"city\": \"Kabupaten Poso\", \"name\": \"Lembah Bada - Situs Megalitikum\", \"slug\": \"lembah-bada-megalitikum\", \"rules\": [\"Wajib menggunakan jasa pemandu lokal\", \"Dilarang menyentuh atau memanjat patung\", \"Dilarang mengambil batu atau artefak\", \"Hormati situs sebagai warisan budaya\"], \"images\": [], \"prices\": [], \"rating\": \"4.9\", \"address\": \"Desa Gintu, Kecamatan Lore Selatan\", \"latitude\": \"-1.66670000\", \"province\": \"Sulawesi Tengah\", \"is_active\": true, \"longitude\": \"120.18330000\", \"created_at\": \"2026-01-04T17:17:45.000000Z\", \"facilities\": [\"Pemandu Lokal\", \"Homestay\", \"Warung\", \"Toilet\", \"Parkir\", \"Pusat Informasi\"], \"updated_at\": \"2026-01-04T17:17:45.000000Z\", \"description\": \"Lembah Bada adalah salah satu dari tiga lembah di Taman Nasional Lore Lindu yang menyimpan lebih dari 400 patung batu megalitikum kuno. Patung-patung misterius ini diperkirakan berusia lebih dari 1.000 tahun dan menjadi salah satu warisan prasejarah paling penting di Indonesia.\\n\\nPatung terkenal seperti Palindo (patung megalit berwajah manusia tertinggi) dan berbagai Kalamba (gentong batu raksasa) dapat ditemukan tersebar di lembah ini. Hingga kini, asal-usul dan fungsi patung-patung ini masih menjadi misteri.\\n\\nSelain situs megalitikum, Lembah Bada juga menawarkan pemandangan sawah terasering dan kehidupan masyarakat adat yang masih tradisional.\", \"is_featured\": true, \"review_count\": 324, \"contact_email\": \"info@tnll-explore.com\", \"contact_phone\": \"+62 451 123458\", \"visitor_count\": 15680, \"operating_hours\": \"07:00 - 17:00 WITA\", \"primary_image_url\": \"http://localhost:8000/assets/logo.png\", \"short_description\": \"Situs prasejarah dengan 400+ patung megalitikum misterius berusia ribuan tahun.\", \"formatted_adult_price\": \"Gratis\"}', '127.0.0.1', 'Symfony', '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `activity_logs` VALUES ('5', NULL, NULL, 'create', 'App\\Models\\Destination', '4', 'Menambahkan destinasi baru: Air Panas Kamarora', NULL, '{\"id\": 4, \"city\": \"Kabupaten Sigi\", \"name\": \"Air Panas Kamarora\", \"slug\": \"air-panas-kamarora\", \"rules\": [\"Wajib mandi bilas sebelum masuk kolam\", \"Dilarang menggunakan sabun di kolam\", \"Anak-anak harus didampingi orang tua\", \"Maksimal berendam 30 menit\"], \"images\": [], \"prices\": [], \"rating\": \"4.5\", \"address\": \"Desa Kamarora, Kecamatan Nokilalaki\", \"latitude\": \"-1.27560000\", \"province\": \"Sulawesi Tengah\", \"is_active\": true, \"longitude\": \"120.12340000\", \"created_at\": \"2026-01-04T17:17:45.000000Z\", \"facilities\": [\"Kolam Air Panas\", \"Kamar Ganti\", \"Toilet\", \"Warung\", \"Parkir\", \"Gazebo\"], \"updated_at\": \"2026-01-04T17:17:45.000000Z\", \"description\": \"Air Panas Kamarora adalah sumber air panas alami yang terletak di pintu masuk Taman Nasional Lore Lindu. Tempat ini menjadi favorit wisatawan untuk bersantai setelah perjalanan panjang menuju destinasi lain di TNLL.\\n\\nAir panas dengan suhu sekitar 40-50 derajat Celsius mengandung mineral alami yang dipercaya baik untuk kesehatan kulit dan relaksasi otot. Fasilitas kolam sudah ditata dengan baik sehingga pengunjung dapat berendam dengan nyaman.\\n\\nDi sekitar lokasi juga dapat ditemukan habitat tarsius (monyet hantu) yang dapat diamati pada malam hari dengan pendampingan guide lokal.\", \"is_featured\": false, \"review_count\": 156, \"contact_email\": \"info@tnll-explore.com\", \"contact_phone\": \"+62 451 123459\", \"visitor_count\": 7830, \"operating_hours\": \"07:00 - 21:00 WITA\", \"primary_image_url\": \"http://localhost:8000/assets/logo.png\", \"short_description\": \"Pemandian air panas alami dengan mineral berkhasiat di pintu masuk TNLL.\", \"formatted_adult_price\": \"Gratis\"}', '127.0.0.1', 'Symfony', '2026-01-05 01:17:45', '2026-01-05 01:17:45');
