INSERT INTO `destinations` VALUES ('1', 'Danau Tambing', NULL, 'danau-tambing', 'Danau Tambing adalah sebuah danau cantik yang terletak di kawasan Taman Nasional Lore Lindu, Sulawesi Tengah. Danau ini berada di ketinggian sekitar 1.700 meter di atas permukaan laut, menjadikannya salah satu destinasi wisata alam paling memukau di Indonesia.
INSERT INTO `destinations` VALUES ('2', 'Danau Lindu', NULL, 'danau-lindu', 'Danau Lindu adalah danau alami terbesar di Taman Nasional Lore Lindu, terletak di tengah kawasan taman nasional pada ketinggian 1.000 meter. Danau ini dikelilingi oleh pegunungan dan hutan hujan tropis yang masih alami.
INSERT INTO `destinations` VALUES ('3', 'Lembah Bada - Situs Megalitikum', NULL, 'lembah-bada-megalitikum', 'Lembah Bada adalah salah satu dari tiga lembah di Taman Nasional Lore Lindu yang menyimpan lebih dari 400 patung batu megalitikum kuno. Patung-patung misterius ini diperkirakan berusia lebih dari 1.000 tahun dan menjadi salah satu warisan prasejarah paling penting di Indonesia.
INSERT INTO `destinations` VALUES ('4', 'Air Panas Kamarora', NULL, 'air-panas-kamarora', 'Air Panas Kamarora adalah sumber air panas alami yang terletak di pintu masuk Taman Nasional Lore Lindu. Tempat ini menjadi favorit wisatawan untuk bersantai setelah perjalanan panjang menuju destinasi lain di TNLL.
INSERT INTO `fauna` VALUES ('1', 'Anoa Dataran Rendah', 'anoa-dataran-rendah', 'Anoa', 'Bubalus depressicornis', 'Kerbau terkecil di dunia yang hanya ditemukan di Sulawesi. Hewan ikonik TNLL dan sangat dilindungi.', NULL, 'fauna/fa1.jpg', NULL, NULL, 'Hutan hujan dataran rendah', 'EN', 'endemik', '1', '1', '0', '0', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('2', 'Tarsius Sulawesi', 'tarsius-sulawesi', 'Tangkasi', 'Tarsius tarsier', 'Primata terkecil di dunia dengan mata besar dan aktif di malam hari. Endemik Sulawesi.', NULL, 'fauna/fa2.jpg', NULL, NULL, 'Hutan sekunder dan primer', 'VU', 'endemik', '1', '1', '0', '1', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('3', 'Maleo', 'maleo', 'Burung Maleo', 'Macrocephalon maleo', 'Burung endemik yang menetaskan telur menggunakan panas bumi. Hanya ada di Sulawesi.', NULL, 'fauna/fa3.jpg', NULL, NULL, 'Hutan pantai dan dataran rendah', 'EN', 'endemik', '1', '1', '0', '2', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('4', 'Babi Rusa', 'babi-rusa', 'Babirusa', 'Babyrousa celebensis', 'Babi unik dengan taring melengkung ke atas menembus moncong. Endemik Sulawesi.', NULL, 'fauna/fa4.jpg', NULL, NULL, 'Hutan hujan tropis', 'VU', 'endemik', '1', '1', '0', '3', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('5', 'Monyet Tonkean', 'monyet-tonkean', 'Monyet Hitam', 'Macaca tonkeana', 'Monyet endemik Sulawesi Tengah. Hidup berkelompok dan mudah dijumpai di TNLL.', NULL, 'fauna/fa5.jpg', NULL, NULL, 'Hutan primer dan sekunder', 'VU', 'endemik', '0', '1', '0', '4', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('6', 'Kuskus Beruang', 'kuskus-beruang', 'Kuse', 'Ailurops ursinus', 'Marsupial arboreal terbesar di Sulawesi. Aktif di malam hari dan pemakan daun.', NULL, 'fauna/fa6.jpg', NULL, NULL, 'Kanopi hutan hujan', 'VU', 'endemik', '0', '1', '0', '5', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('7', 'Elang Sulawesi', 'elang-sulawesi', 'Elang Bondol', 'Nisaetus lanceolatus', 'Elang endemik predator puncak di ekosistem TNLL. Berburu mamalia kecil dan reptil.', NULL, 'fauna/fa7.jpg', NULL, NULL, 'Hutan pegunungan', 'NT', 'endemik', '0', '1', '0', '6', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('8', 'Rangkok Sulawesi', 'rangkok-sulawesi', 'Julang', 'Rhyticeros cassidix', 'Burung besar dengan tanduk di atas paruh. Penting untuk penyebaran biji hutan.', NULL, 'fauna/fa8.jpg', NULL, NULL, 'Hutan primer dataran rendah', 'VU', 'endemik', '0', '1', '0', '7', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('9', 'Kadal Terbang', 'kadal-terbang', 'Cikibor', 'Draco volans', 'Kadal dengan membran kulit untuk meluncur antar pohon. Pemandangan menarik di hutan.', NULL, 'fauna/fa9.jpg', NULL, NULL, 'Hutan tropis', 'LC', 'umum', '0', '1', '0', '8', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('10', 'Ular Sanca', 'ular-sanca', 'Piton', 'Python reticulatus', 'Ular terpanjang di dunia. Predator puncak yang penting untuk keseimbangan ekosistem.', NULL, 'fauna/fa10.jpg', NULL, NULL, 'Hutan dan tepi sungai', 'LC', 'umum', '0', '1', '0', '9', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('11', 'Kupu-kupu Sayap Burung', 'kupu-kupu-sayap-burung', 'Kupu Raksasa', 'Ornithoptera croesus', 'Kupu-kupu terbesar dan tercantik di Indonesia. Dilindungi dan bernilai tinggi.', NULL, 'fauna/fa11.jpg', NULL, NULL, 'Hutan hujan', 'NT', 'langka', '1', '1', '0', '10', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('12', 'Burung Nuri', 'burung-nuri', 'Kasturi', 'Lorius garrulus', 'Burung berwarna-warni yang cerdas. Sering terdengar suaranya di hutan.', NULL, 'fauna/fa12.jpg', NULL, NULL, 'Hutan tropis', 'VU', 'langka', '0', '1', '0', '11', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('13', 'Katak Terbang', 'katak-terbang', 'Katak Pohon', 'Rhacophorus reinwardtii', 'Katak dengan selaput kaki lebar untuk meluncur. Hidup di kanopi hutan hujan.', NULL, 'fauna/fa13.jpg', NULL, NULL, 'Kanopi hutan hujan', 'NT', 'umum', '0', '1', '0', '12', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('14', 'Biawak Air', 'biawak-air', 'Soa-soa', 'Varanus salvator', 'Reptil besar yang mahir berenang. Sering dijumpai di tepi Danau Lindu.', NULL, 'fauna/fa14.jpg', NULL, NULL, 'Tepi sungai dan danau', 'LC', 'umum', '0', '1', '0', '13', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('15', 'Ikan Sidat', 'ikan-sidat', 'Masapi', 'Anguilla marmorata', 'Ikan air tawar yang bermigrasi ke laut. Kuliner khas Danau Lindu.', NULL, 'fauna/fa15.jpg', NULL, NULL, 'Danau dan sungai', 'LC', 'umum', '0', '1', '0', '14', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('16', 'Belut Listrik', 'belut-listrik', 'Sogili', 'Anguilla celebesensis', 'Ikan endemik Danau Lindu dengan kemampuan menghasilkan listrik lemah.', NULL, 'fauna/fa16.jpg', NULL, NULL, 'Danau Lindu', 'EN', 'endemik', '0', '1', '0', '15', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('17', 'Burung Julang', 'burung-julang', 'Kangkareng', 'Penelopides exarhatus', 'Burung enggang endemik dengan suara khas yang menggema di hutan.', NULL, 'fauna/fa17.jpg', NULL, NULL, 'Hutan pegunungan', 'VU', 'endemik', '0', '1', '0', '16', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('18', 'Musang Sulawesi', 'musang-sulawesi', 'Musang Luwak', 'Macrogalidia musschenbroekii', 'Kucing liar terbesar di Sulawesi. Endemik dan sangat jarang terlihat.', NULL, 'fauna/fa18.jpg', NULL, NULL, 'Hutan primer pegunungan', 'VU', 'endemik', '0', '1', '0', '17', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('19', 'Tikus Raksasa', 'tikus-raksasa', 'Tikus Bunomys', 'Bunomys chrysocomus', 'Tikus endemik berukuran besar. Indikator kesehatan ekosistem hutan.', NULL, 'fauna/fa19.jpg', NULL, NULL, 'Hutan pegunungan', 'LC', 'endemik', '0', '1', '0', '18', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('20', 'Kelelawar Buah', 'kelelawar-buah', 'Paniki', 'Pteropus alecto', 'Kelelawar besar pemakan buah. Penting untuk penyerbukan dan penyebaran biji.', NULL, 'fauna/fa20.jpg', NULL, NULL, 'Hutan dan perkebunan', 'LC', 'umum', '0', '1', '0', '19', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('21', 'Kakatua Jambul Kuning', 'kakatua-jambul-kuning', 'Kakatua', 'Cacatua sulphurea', 'Burung cerdas dengan jambul kuning. Terancam punah karena perdagangan ilegal.', NULL, 'fauna/fa21.jpg', NULL, NULL, 'Hutan dan tepi hutan', 'CR', 'langka', '1', '1', '0', '20', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('22', 'Rusa Sulawesi', 'rusa-sulawesi', 'Rusa', 'Rusa timorensis', 'Rusa yang beradaptasi dengan lingkungan Sulawesi. Sering terlihat di padang rumput.', NULL, 'fauna/fa22.jpg', NULL, NULL, 'Padang rumput dan hutan', 'VU', 'umum', '0', '1', '0', '21', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `fauna` VALUES ('23', 'Kuda Nil Kerdil', 'kuda-nil-kerdil', 'Anoa Gunung', 'Bubalus quarlesi', 'Anoa yang hidup di pegunungan. Lebih kecil dari anoa dataran rendah.', NULL, 'fauna/fa23.jpg', NULL, NULL, 'Hutan pegunungan', 'EN', 'endemik', '1', '1', '0', '22', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
