INSERT INTO `flora` VALUES ('1', 'Anggrek Hitam', 'anggrek-hitam', 'Anggrek Sulawesi', 'Coelogyne pandurata', 'Anggrek langka endemik Sulawesi dengan kelopak berwarna hijau kekuningan dan lidah hitam. Ditemukan di hutan pegunungan TNLL.', NULL, 'flora/fl1.jpg', NULL, NULL, 'endemik', NULL, '1', '1', '1', '0', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 22:21:27');
INSERT INTO `flora` VALUES ('2', 'Kantong Semar', 'kantong-semar', 'Tumbuhan Karnivora', 'Nepenthes maxima', 'Tumbuhan karnivora yang menangkap serangga dengan kantong berbentuk periuk. Banyak ditemukan di daerah lembab.', NULL, 'flora/fl2.jpg', NULL, NULL, 'langka', NULL, '1', '1', '0', '1', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('3', 'Raflesia', 'raflesia', 'Bunga Bangkai', 'Rafflesia arnoldii', 'Bunga terbesar di dunia yang hanya mekar beberapa hari. Sangat langka dan dilindungi.', NULL, 'flora/fl3.jpg', NULL, NULL, 'langka', NULL, '1', '1', '0', '2', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('4', 'Paku Tiang', 'paku-tiang', 'Paku Pohon', 'Cyathea contaminans', 'Paku raksasa yang tumbuh di hutan hujan tropis pegunungan. Dapat mencapai tinggi 15 meter.', NULL, 'flora/fl4.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '3', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('5', 'Cemara Gunung', 'cemara-gunung', 'Cemara Sulawesi', 'Casuarina junghuhniana', 'Pohon cemara yang tumbuh di ketinggian 1500-2500 mdpl. Pohon ikonik di sekitar Danau Tambing.', NULL, 'flora/fl5.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '4', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('6', 'Rotan Lore', 'rotan-lore', 'Uwi', 'Calamus sp.', 'Jenis rotan endemik yang banyak digunakan masyarakat lokal untuk kerajinan tradisional.', NULL, 'flora/fl6.jpg', NULL, NULL, 'endemik', NULL, '0', '1', '0', '5', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('7', 'Pakis Haji', 'pakis-haji', 'Pakis Raja', 'Cycas rumphii', 'Tumbuhan purba yang masih bertahan hingga kini. Fosil hidup yang dilindungi.', NULL, 'flora/fl7.jpg', NULL, NULL, 'langka', NULL, '0', '1', '0', '6', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('8', 'Bambu Hitam', 'bambu-hitam', 'Bambu Petung', 'Gigantochloa atroviolacea', 'Bambu dengan batang berwarna ungu kehitaman. Digunakan untuk konstruksi dan kerajinan.', NULL, 'flora/fl8.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '7', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('9', 'Kayu Eboni', 'kayu-eboni', 'Kayu Hitam Sulawesi', 'Diospyros celebica', 'Kayu mewah endemik Sulawesi dengan warna hitam pekat. Sangat langka dan dilindungi.', NULL, 'flora/fl9.jpg', NULL, NULL, 'endemik', NULL, '1', '1', '0', '8', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('10', 'Lumut Tanduk', 'lumut-tanduk', 'Lumut Hutan', 'Anthoceros sp.', 'Lumut unik yang tumbuh di batang pohon hutan hujan. Indikator kualitas udara yang baik.', NULL, 'flora/fl10.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '9', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('11', 'Bunga Edelweis Jawa', 'bunga-edelweis-jawa', 'Bunga Abadi', 'Anaphalis javanica', 'Bunga ikonik pegunungan tinggi yang tidak layu. Simbol keabadian dan cinta sejati.', NULL, 'flora/fl11.jpg', NULL, NULL, 'langka', NULL, '0', '1', '0', '10', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('12', 'Pinus Merkusii', 'pinus-merkusii', 'Tusam', 'Pinus merkusii', 'Satu-satunya pinus tropis asli Indonesia. Tumbuh di ketinggian 800-2000 mdpl.', NULL, 'flora/fl12.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '11', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('13', 'Daun Sang', 'daun-sang', 'Pohon Payung', 'Johannesteijsmannia altifrons', 'Palem dengan daun raksasa berbentuk kipas. Daun dapat mencapai lebar 6 meter.', NULL, 'flora/fl13.jpg', NULL, NULL, 'langka', NULL, '0', '1', '0', '12', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
INSERT INTO `flora` VALUES ('14', 'Wijaya Kusuma', 'wijaya-kusuma', 'Bunga Malam', 'Epiphyllum oxypetalum', 'Kaktus epifit yang berbunga di malam hari. Bunga wangi dan hanya mekar semalam.', NULL, 'flora/fl14.jpg', NULL, NULL, 'umum', NULL, '0', '1', '0', '13', NULL, NULL, '2026-01-05 01:17:45', '2026-01-05 01:17:45');
