Air danau yang jernih berwarna hijau kebiruan mencerminkan keindahan alam sekitarnya, termasuk pepohonan rapat dan langit biru. Suasana tenang dan sejuk khas pegunungan tropis menjadikan tempat ini sempurna untuk healing dan menikmati keindahan alam.

Danau Tambing tidak hanya menjadi daya tarik wisata, tetapi juga memiliki nilai ekologis tinggi sebagai habitat berbagai spesies flora dan fauna endemik Sulawesi.', 'Danau eksotis di ketinggian 1.700 mdpl dengan pemandangan hutan pegunungan yang masih asri.', 'Desa Sedoa, Kecamatan Lore Utara', 'Kabupaten Poso', 'Sulawesi Tengah', '-1.32110000', '120.18500000', NULL, '07:00 - 17:00 WITA', '+62 451 123456', 'info@tnll-explore.com', '[\"Toilet\", \"Warung\", \"Parkir Motor & Mobil\", \"Gazebo\", \"Jembatan Bambu\", \"Spot Foto\", \"Area Camping\"]', '[\"Dilarang membuang sampah sembarangan\", \"Dilarang berenang di danau\", \"Dilarang membawa hewan peliharaan\", \"Wajib menjaga ketenangan\", \"Dilarang memetik tanaman dan mengganggu satwa\", \"Pembayaran tiket non-tunai (cashless)\"]', NULL, NULL, NULL, NULL, '1', '1', '4.8', '256', '12450', '0', '2026-01-05 01:17:45', '2026-01-05 01:17:45', NULL);

Masyarakat suku Lindu yang tinggal di sekitar danau masih mempertahankan tradisi dan kearifan lokal mereka. Anda bisa berinteraksi dengan penduduk, memancing bersama warga lokal, atau menyewa perahu ketinting untuk mengelilingi danau.

Danau Lindu juga merupakan habitat bagi beberapa spesies ikan endemik yang hanya ditemukan di sini.', 'Danau alami terbesar di TNLL dengan kehidupan masyarakat adat Lindu yang masih asli.', 'Desa Tomado, Kecamatan Lindu', 'Kabupaten Sigi', 'Sulawesi Tengah', '-1.30890000', '120.06670000', NULL, '06:00 - 18:00 WITA', '+62 451 123457', 'info@tnll-explore.com', '[\"Dermaga Perahu\", \"Homestay\", \"Warung Makan\", \"Toilet\", \"Spot Memancing\", \"Parkir\"]', '[\"Hormati adat istiadat masyarakat Lindu\", \"Dilarang membuang sampah ke danau\", \"Sewa perahu melalui koperasi desa\", \"Wajib didampingi pemandu lokal (tracking)\"]', NULL, NULL, NULL, NULL, '1', '1', '4.7', '189', '8920', '0', '2026-01-05 01:17:45', '2026-01-05 01:17:45', NULL);

Patung terkenal seperti Palindo (patung megalit berwajah manusia tertinggi) dan berbagai Kalamba (gentong batu raksasa) dapat ditemukan tersebar di lembah ini. Hingga kini, asal-usul dan fungsi patung-patung ini masih menjadi misteri.

Selain situs megalitikum, Lembah Bada juga menawarkan pemandangan sawah terasering dan kehidupan masyarakat adat yang masih tradisional.', 'Situs prasejarah dengan 400+ patung megalitikum misterius berusia ribuan tahun.', 'Desa Gintu, Kecamatan Lore Selatan', 'Kabupaten Poso', 'Sulawesi Tengah', '-1.66670000', '120.18330000', NULL, '07:00 - 17:00 WITA', '+62 451 123458', 'info@tnll-explore.com', '[\"Pemandu Lokal\", \"Homestay\", \"Warung\", \"Toilet\", \"Parkir\", \"Pusat Informasi\"]', '[\"Wajib menggunakan jasa pemandu lokal\", \"Dilarang menyentuh atau memanjat patung\", \"Dilarang mengambil batu atau artefak\", \"Hormati situs sebagai warisan budaya\"]', NULL, NULL, NULL, NULL, '1', '1', '4.9', '324', '15684', '4', '2026-01-05 01:17:45', '2026-01-06 01:16:31', NULL);

Air panas dengan suhu sekitar 40-50 derajat Celsius mengandung mineral alami yang dipercaya baik untuk kesehatan kulit dan relaksasi otot. Fasilitas kolam sudah ditata dengan baik sehingga pengunjung dapat berendam dengan nyaman.

Di sekitar lokasi juga dapat ditemukan habitat tarsius (monyet hantu) yang dapat diamati pada malam hari dengan pendampingan guide lokal.', 'Pemandian air panas alami dengan mineral berkhasiat di pintu masuk TNLL.', 'Desa Kamarora, Kecamatan Nokilalaki', 'Kabupaten Sigi', 'Sulawesi Tengah', '-1.27560000', '120.12340000', NULL, '07:00 - 21:00 WITA', '+62 451 123459', 'info@tnll-explore.com', '[\"Kolam Air Panas\", \"Kamar Ganti\", \"Toilet\", \"Warung\", \"Parkir\", \"Gazebo\"]', '[\"Wajib mandi bilas sebelum masuk kolam\", \"Dilarang menggunakan sabun di kolam\", \"Anak-anak harus didampingi orang tua\", \"Maksimal berendam 30 menit\"]', NULL, NULL, NULL, NULL, '0', '1', '4.5', '156', '7830', '0', '2026-01-05 01:17:45', '2026-01-05 01:17:45', NULL);

